// DataAndExtractLink.js
import React, { useState, useEffect } from 'react';

const DataAndExtractLink = ({ children }) => {
  const [link, setLink] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('https://api.adkey-seo.com/api/website/get-website/295');
        const data = await response.json();

        if (data.offers && data.offers.length > 0) {
          const link = data.offers[0].link;
          setLink(link);
        }
      } catch (error) {
        console.error(`Помилка при виконанні запиту: ${error.message}`);
      }
    };

    fetchData();
  }, []);

  return children(link);
};

export default DataAndExtractLink;
